import axios from "axios";
import InfoItem from "./InfoItem";
const Info = () => {
  const [data, setData] = useState([]);

  const fetchData = () => {
    axios.get("https://api.spacexdata.com/v4/company").then((response) => {
      console.log(response.data);
      setData(response.data);
    });
  };

  useEffect(() => {
    fetchData();
  }, []);

  return (
    <div className="container my-5" style={{ marginTop:"90px"}}>
      {data.map((res)=>{
        console.log(res.cto_propulsion,"hello");
        return(
          // <InfoItem />
          <h1>{res.ceo}</h1>
        )
       })}

    </div>
  );
};

export default Info

